जब आप ब्राउज़र में हों तब ड्रा और डूडल करना चाहते हैं? {{}

बस आज इस सॉफ्टवेयर को स्थापित करें और आप जहां हैं वहां कोई फर्क नहीं पड़ना शुरू कर सकते हैं। {{}

शुरू करने के लिए, बस अपनी पेंसिल का रंग चुनें और आकर्षित करने के लिए माउस का उपयोग करना शुरू करें।

यदि आप कोई गलती करते हैं, तो बस "पूर्ववत करें" बटन दबाएं। इस सरल स्केचपैड सॉफ्टवेयर का उपयोग करके आज ड्राइंग शुरू करें। {२}

