अस्वीकरण: कृपया ध्यान दें कि यह एक्सटेंशन Google द्वारा नहीं बनाया गया है और यह एक स्वतंत्र विकास दल द्वारा बनाया गया है। समस्त कॉपीराइट उनके संबंधित स्वामियों की संपत्ति हैं।
Google इस एक्सटेंशन का समर्थन या प्रायोजन नहीं करता है। Google Chrome के लिए स्केचपैड स्वामित्व नहीं है, इसके द्वारा लाइसेंस प्राप्त नहीं है और यह Google Inc. की सहायक कंपनी नहीं है।
